import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faHtml5,
  faCss3,
  faJs,
  faNodeJs,
  faReact,
} from "@fortawesome/free-brands-svg-icons";
import html from "../assets/html5.png";
import css from "../assets/css.jpg";
import js from "../assets/js.png";
import nodeJs from "../assets/nodejs.png";
import react from "../assets/react.png";
import tailwind from "../assets/tailwind.svg";
import mongodb from "../assets/mongodb.png";
import express from "../assets/express.png";
import mysql from "../assets/mysql.png";

function Skills() {
  const logos = [
    { name: "html", icon: html, type: "image" },
    { name: "css", icon: css, type: "image" },
    { name: "js", icon: js, type: "image" },
    { name: "node", icon: nodeJs, type: "image" },
    { name: "react", icon: react, type: "image" },
    { name: "tailwind", icon: tailwind, type: "image" },
    { name: "mongodb", icon: mongodb, type: "image" },
    { name: "express", icon: express, type: "image" },
    { name: "mysql", icon: mysql, type: "image" },
  ];

  return (
    <div className="bg-white">
      <div className="flex justify-center text-darkTone text-5xl font-racing w-full p-10">
        Tech Stack
      </div>
      <div className="flex justify-evenly">
        {logos.map((item, index) => (
          <div key={index} className="border-2 border-lightTone p-5 rounded-xl">
            {item.type === "awesomeFont" ? (
              <FontAwesomeIcon size="5x" icon={item.icon} />
            ) : (
              <img
                className="w-16 h-16 object-contain"
                src={item.icon}
                alt={item.name}
              />
            )}
          </div>
        ))}
      </div>
    </div>
  );
}

export default Skills;
